import React from 'react';
import { FormControl, Row, Col } from 'react-bootstrap'
import './Players.css'

const Players = ({playerList}) => {
  return (
    <div>
      <Row className="justify-content-center mb-2">
        <Col xs={5}>
          <FormControl className="playerEntry" size="sm" type="name" placeholder="new player" />
        </Col>
        <Col xs={1}>
          
        </Col>
      </Row>
    <>
      {playerList.map(player => (<div className="player" key={player}>{player}</div>))}
    </>
    </div>
    
  );
}

export default Players;
